import {useState} from "react"

export default function Donnees(){

    // state ou données

    const [animaux, setAnimaux] = useState([
        {id:1, nom:"chat"},
        {id:2, nom:"lion"},
        {id:3, nom:"chien"},
        {id:4, nom:"aigle"}
    ])

    // comportements


    // affichage
    return(
        <>
            {animaux.map(animal=>{
                return <Personnes keys={animal.id} {...animal} animal={animal} animaux={animaux} setAnimaux={setAnimaux}/>
            })}
        </>
    )
}
